class HunterGame:
    def __init__(self, g: str, k: str, p: float) -> None:
        self.g = g
        self.k = k
        self.p = p
        self.turns = 0

    def run(self) -> str:
        if not (self.g.count('H') == 1 and self.g.count('T') == 1 and self.k.count('H') == 1 and self.k.count('T') == 1):
            raise ValueError('Strings must contain only characters \'H\' and \'T\'')

        self._simulate_game()

        if self.turns == 0:
            return 'Draw'
        elif self.g in self.s or self.k in self.s:
            return 'Gon'
        else:
            return 'Killua'

    def _simulate_game(self) -> None:
        self.s = ''
        while self.turns < 10**100:
            self.turns += 1
            if self.turns % 2 == 0:
                self.s += 'H' if random.random() < self.p else 'T'
            else:
                self.s += 'T' if random.random() < self.p else 'H'

